import './ImageCard.css';

const ImageCard = ({image, name}) => {
    return (
            <div className='card col-md-3' style={{
            backgroundColor: 'rgb(46, 46, 44)',
            width: '100%',
            border:'none',
            marginBottom:'20px',
            marginTop:'20px'
        }}>
            <div className='content'>
            <div className='card-body-top'>
                <h4 className='card-text' style={{
                    color:'rgb(168, 166, 166)',
                    fontWeight: '100'
                }}> 
                    {name}
                </h4>
               
            </div>
            <hr style={{
                    backgroundColor:'grey'
                }}/>
            <a onClick={console.log('sahdev')} href='dx'>
            <img className='card-img singleImage' src={image} alt='card' style={{
                width: '100%',
                borderRadius:'10px'
            }} />
            </a>
           </div>
           
            
        </div>
        
        // <div class="card">
        //     <img class="card-img-top" src="..." alt="Card image cap">
        //     <div class="card-body">
        //         <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
        //     </div>
        // </div>
    );
}

export default ImageCard;
